import React from "react";

const PaginationButton = ({ onClick, isNext }) => {
  return (
    <div>
      <div className="container">
        <div className="row">
          <div className="col-12">
            {isNext ? (
              <button className="mx-3 my-5" onClick={onClick}>
                Next
              </button>
            ) : (
              <button className="mx-3 my-5" onClick={onClick}>
                Previous
              </button>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default PaginationButton;
